import React, { Component } from 'react';
import Nav from 'react-bootstrap/Nav'
import Navbar from 'react-bootstrap/Navbar'
import Form from 'react-bootstrap/Form'
import FormControl from 'react-bootstrap/FormControl'
import Button from 'react-bootstrap/Button'
import { Link } from 'react-router-dom';
import { MDBCol, MDBFormInline, MDBBtn } from "mdbreact";




class Header extends Component {
  constructor(props) {
    super(props);
    this.state = {}
  }
  render() {
    return (
      <Navbar style={{width: '100%'}}>
        <Navbar.Brand href="#home"><img src={require('./images/logo.png')} style={{ width: '120px', height: '120px' }} /></Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link style={{border: '1px solid'}}><Link to='/'>Home</Link></Nav.Link>
            <Nav.Link><Link to='/products'>Products</Link></Nav.Link>
            <Nav.Link><Link to='/events'>Events</Link></Nav.Link>
            <Nav.Link><Link to='/jewelry-care'>Jewelry Care</Link></Nav.Link>
            <Nav.Link><Link to='/contact'>Contact US</Link></Nav.Link>
          </Nav>

          <Form inline>
          <input className="form-control mr-sm-2" type="text" placeholder="Search" aria-label="Search" />
        <MDBBtn outline color="warning" rounded size="sm" type="submit" className="mr-auto">
          Search
        </MDBBtn>
          </Form>
        </Navbar.Collapse>
      </Navbar>

    );
  }
}


export default Header;
